<?php

namespace Database\Factories;

use App\Models\PsychologistData;
use App\Models\User;
use Illuminate\Database\Eloquent\Factories\Factory;

class PsychologistDataFactory extends Factory
{

    protected $model = PsychologistData::class;

    public function definition(): array
    {
        $this->faker->addProvider(new \Faker\Provider\Youtube($this->faker));

        return [
            'id' => User::inRandomOrder()->first()->id,
            'avatar' => "",
            'experience' => $this->faker->numberBetween(1, 26),
            'description' => $this->faker->realText(),
            'video_link' => $this->faker->youtubeUri(),
        ];
    }
}
